def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        return ""
    parts = input1.split()
    result = []
    for part in parts:
        sub_parts = part.split('-')
        transformed_sub_parts = [sub_parts[0]] + [sub.capitalize() for sub in sub_parts[1:]]
        result.append(''.join(transformed_sub_parts))
    return ' '.join(result)
